import { Logo } from "./Logo";
import "./Footer.css"

import logoFooter from '../img/logo-footer.svg';

export const Footer = () => {
    return (
      <footer className="Footer">
                <Logo logo={logoFooter} position="footer" />
      </footer>
    );
}
